import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import './App.css';

// Components
import Dashboard from './components/Dashboard';
import OnboardingFlow from './components/OnboardingFlow';
import MealLogForm from './components/MealLogForm';
import BadgeCollection from './components/BadgeCollection';
import SwapModal from './components/SwapModal';

// Services
import { apiService } from './services/api';

// Types
import { User } from './types';

function App() {
  const [user, setUser] = useState<User | null>(null);
  const [isLoading, setIsLoading] = useState(true);
  const [showMealForm, setShowMealForm] = useState(false);
  const [showSwapModal, setShowSwapModal] = useState(false);
  const [selectedMealId, setSelectedMealId] = useState<number | null>(null);

  // Check if user is logged in on app start
  useEffect(() => {
    const checkAuth = async () => {
      const token = localStorage.getItem('access_token');
      if (token) {
        try {
          const userData = await apiService.getCurrentUser();
          setUser(userData);
        } catch (error) {
          localStorage.removeItem('access_token');
        }
      }
      setIsLoading(false);
    };

    checkAuth();
  }, []);

  const handleLogin = (userData: User) => {
    setUser(userData);
  };

  const handleLogout = () => {
    apiService.logout();
    setUser(null);
  };

  const openSwapModal = (mealId: number) => {
    setSelectedMealId(mealId);
    setShowSwapModal(true);
  };

  if (isLoading) {
    return (
      <div className="min-h-screen bg-gradient-to-br from-green-50 to-blue-50 flex items-center justify-center">
        <div className="text-center">
          <div className="animate-spin rounded-full h-12 w-12 border-b-2 border-green-500 mx-auto mb-4"></div>
          <p className="text-gray-600">Greenflow Life Î°úÎî© Ï§ë...</p>
        </div>
      </div>
    );
  }

  return (
    <Router>
      <div className="min-h-screen bg-gradient-to-br from-green-50 to-blue-50">
        {/* Navigation Header */}
        {user && (
          <nav className="bg-white shadow-sm border-b border-green-100">
            <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
              <div className="flex justify-between items-center h-16">
                <div className="flex items-center">
                  <h1 className="text-xl font-bold text-green-800">
                    üå± Greenflow Life
                  </h1>
                </div>
                <div className="flex items-center space-x-4">
                  <span className="text-gray-700">ÏïàÎÖïÌïòÏÑ∏Ïöî, {user.name}Îãò!</span>
                  <button
                    onClick={() => setShowMealForm(true)}
                    className="bg-green-500 hover:bg-green-600 text-white px-4 py-2 rounded-md text-sm font-medium transition-colors"
                  >
                    + ÏãùÏÇ¨ Ï∂îÍ∞Ä
                  </button>
                  <button
                    onClick={handleLogout}
                    className="text-gray-500 hover:text-gray-700 text-sm"
                  >
                    Î°úÍ∑∏ÏïÑÏõÉ
                  </button>
                </div>
              </div>
            </div>
          </nav>
        )}

        <Routes>
          {/* Authentication Route */}
          <Route 
            path="/onboarding" 
            element={
              user ? <Navigate to="/dashboard" /> : <OnboardingFlow onComplete={handleLogin} />
            } 
          />

          {/* Main Dashboard */}
          <Route 
            path="/dashboard" 
            element={
              user ? (
                <Dashboard 
                  user={user} 
                  onMealClick={openSwapModal}
                />
              ) : (
                <Navigate to="/onboarding" />
              )
            } 
          />

          {/* Badges Page */}
          <Route 
            path="/badges" 
            element={
              user ? <BadgeCollection /> : <Navigate to="/onboarding" />
            } 
          />

          {/* Default Route */}
          <Route 
            path="/" 
            element={
              user ? <Navigate to="/dashboard" /> : <Navigate to="/onboarding" />
            } 
          />
        </Routes>

        {/* Meal Log Modal */}
        {showMealForm && user && (
          <div className="fixed inset-0 bg-black bg-opacity-50 flex items-center justify-center p-4 z-50">
            <div className="bg-white rounded-lg max-w-md w-full max-h-[90vh] overflow-y-auto">
              <div className="p-6">
                <div className="flex justify-between items-center mb-4">
                  <h2 className="text-xl font-bold text-gray-900">ÏãùÏÇ¨ Í∏∞Î°ù Ï∂îÍ∞Ä</h2>
                  <button
                    onClick={() => setShowMealForm(false)}
                    className="text-gray-400 hover:text-gray-600"
                  >
                    ‚úï
                  </button>
                </div>
                <MealLogForm 
                  onSubmit={(mealData) => {
                    // Handle meal submission
                    setShowMealForm(false);
